{'author': 'eleisha_is_fullysik', 'dateCreated': '2023-01-06', 'inLanguage': 'English', 'heading': 'If you&apos;re thinking of watching, do it!', 'reviewBody': 'I went into this movie with little expectations, and came out with this added to one of my favourite films of all time. I felt every emotion during this experience. I couldn&apos;t picture anyone else play the character of Otto, Tom hanks absolutely nailed it in this. Along with the female lead, she was hilarious and had the whole cinema laughing at times!

I will recommend this film for a long time. I go to the cinema once a week atleast and this has been the best watch in a very long time.

Don&apos;t forget to bring your tissues. It&apos;ll have you on an emotional roller coaster but you won&apos;t want to get off.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'masonsaul', 'dateCreated': '2023-10-15', 'inLanguage': 'English', 'heading': 'Intense', 'reviewBody': 'Accused puts a very timely spin on the home invasion genre. Creating something of the moment that&apos;s terrifying because even its most ridiculous moments feel all too real. An intense look at the dangers of putting too much of your personal life online and how mob mentality has only gotten worse in a world of social media.

It&apos;s essentially a one man show Chaneil Kular who rises to the task flawlessly. It&apos;s briefly easy going for him in the earlier moments until he sees what&apos;s happening online and then spends the rest of the film in a palpable state of fear which only gets worse as people put words into action for the final stretch.

Philip Barantini is a master of suspense, there&apos;s never a break once things go wrong. The constant escalation is so good and the actual home invasion sequence feels like it goes on forever in the best way. The score by Aaron May and David Ridley further ratchets up the intensity with its oppressive nature.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'magnoliacream', 'dateCreated': '2023-09-16', 'inLanguage': 'English', 'heading': 'Cinderella with a twist', 'reviewBody': 'Little Red Riding Hood (Kanna Hashimoto), an adventurous and inquisitive girl, sets off on a journey to enrich her life. She meets a bedraggled girl who introduces herself as Cinderella (Y√ªko Araki). Little Red Riding Hood goes to the ball with her. She also helps authorities uncover a mystery or two.

Those who think this is just another take on an oft-repeated tale, think again. The story is very daring, turning as beloved a fairytale as Cinderella on its head. I bet you would not expect what happens in the end. Question every scene and see if you can find clues along the way.

I actually liked it. Mysteries and twists always entertain when they are plausible. And the story makes them so.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'phd_travel', 'dateCreated': '2023-10-09', 'inLanguage': 'English', 'heading': 'Stylishly violent thriller with star quality leads', 'reviewBody': 'This is the action thriller of the year. It&apos;s been proven before that Korean action thrillers are well done from Man from Nowhere to No Mercy. In Ballerina there is a quick emotional involvement with the characters that grips and then lots of convincing original action. And the actors have star quality and charisma that keeps you watching. So it&apos;s an entertaining gripping watch that isn&apos;t too long. The violence is quite something even for jaded action fans. The fighting is brilliantly choreographed.

A shout out to the leading cast members who really make this show. Terrific female lead Jeong Jeon Seo has an attitude and modern look that suits this type of movie perfectly. Kim Ji Hoon gives another convincing villain performance. He was great in Flower of Evil and he does it again here.

Luc Besson fans will like this one. Though it is less comical than Besson movies.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'smletony', 'dateCreated': '2023-10-27', 'inLanguage': 'English', 'heading': 'Predictable, yet enjoyable', 'reviewBody': 'There was one important nuance that has made this movie about an imminent and predictable collapse of a get-rich-quick-scheme special and orders of magnitude more enjoyable than your typical crypto scam story: the dude who pointed out halfway through the story how all these self deemed crypto evangelists are harmful to the space and they should read the Bitcoin Standard and study some economics to recognise the Ponzi they got stuck up in.

Props to the writers for adding this, otherwise the film was suitable for a pastime.

Moral of the story: DYOR, invest in Bitcoin, self custody and cut out the noise.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'tildiz149', 'dateCreated': '2023-04-01', 'inLanguage': 'English', 'heading': 'I wanted to like this more.', 'reviewBody': 'I was hoping for longer sex scenes, much more clarity and a few more flashbacks. I¬¥m barely informed about Ninas and Janeks past! Why did they break up in the first place? Do they feel some kind of sexual tension that lasts very long? What future can Nina and Janek have? I must say that the script could have been better. Or was this movie loosely based on the script?

My dear parents have traveled to Iceland. They were happy with that journey. But what made Maciek go to Iceland? Business, pleasure, the gorgeous Icelandic nature or something else? Or was it just convenient for the attempt of the story lines development? If you ask me I would answer: the nature and yes.

All in all, this wasn¬¥t the worst movie I¬¥ve watched. It was tolerable, but not exceptionally great.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'satksri-92208', 'dateCreated': '2023-05-30', 'inLanguage': 'English', 'heading': 'Sensitive, Beautiful & True to the core', 'reviewBody': 'A simple tale- of kids, their struggling parents, a sincere teacher, and of the harsh realities of a make shift rail-road community. The story is close to life and brings out the best in the characters, despite poverty and inequities of rural life. It captures the wonder and the joy of growing up with friends. Ikal, the child, is brought back to the school as if by fate, where he had all this amazing time; The school needs him. He also meets his childhood love - and effortlessly slips into his new role as a teacher - something he always wanted to do- inspired by his late teacher Ms Georgina.

The unique thing about the movie is- it captures childhood without any hype. It makes no contrived effort to lead the story to a good end. Above all, it inspires the viewer to see GOOD in people and circumstances.

Inspiring Movie.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'lesley_65', 'dateCreated': '2023-09-02', 'inLanguage': 'English', 'heading': 'Started well but petered out', 'reviewBody': 'This movie started out well with a tense and engaging scene in which a troubled young man (Artan) kidnaps his estranged wife (Louise) at work. The background to their estrangement is hinted at in this first scene and gradually revealed throughout the movie. The highlight is a dramatic and very entertaining encounter with Louise&apos;s parents in which much is exposed about the family dynamics. Unfortunately the movie doesn&apos;t sustain these heights and indeed I was losing interest by the end and feeling frustrated that so little was explained about Artan&apos;s back story.

If you&apos;re looking for a realistic, emotional family drama that feels like it&apos;s being played out in real time you&apos;ll probably enjoy this movie. However, if you&apos;re looking for a thriller or a psychological drama that keeps you guessing you&apos;ll probably be disappointed by the end.

The acting and photography are excellent throughout. Fares Fares is wonderful as the police negotiator with his usual understated, compassionate presence that any fan of the Department Q films will appreciate.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'estherechegollen', 'dateCreated': '2023-04-23', 'inLanguage': 'English', 'heading': 'A laughed so much', 'reviewBody': 'I laughed so much from the beginning to the end, all the actors were awesome I tell you I laugh so much it&apos;s a must see. I don&apos;t want to spoil the movie but you have to watch it. It is hilarious.. awesome job everybody! I had to put it in pause so I can finish laughing and continue watching.

A very good storytelling that it makes you think it can happen. It can be from a real story. The actresses they&apos;re so funny. And the chicken. Oh my gosh you have to watch it. It&apos;s hilarious.

It hurt me to see what happened to the convertible car because that&apos;s a really nice looking car. The kids actors. They did a great job too. So kudos to everybody.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'greasygirlgoneclean', 'dateCreated': '2022-06-25', 'inLanguage': 'English', 'heading': 'How is this rated so low?!', 'reviewBody': 'LOVED THIS! Such a sweet story, so uplifting, and fills you with hope.

Watched it with my 9 & 12 year old girls and we all fell in love with the story.

Great music, great movie! Highly UNDERRATED!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'justasmisiuk', 'dateCreated': '2022-12-18', 'inLanguage': 'English', 'heading': 'Who cares that it&apos;s unrealistic', 'reviewBody': 'The movie was fun, although, a very Hallmark channel type of movie. C&apos;mon, a working girl meets a guy really into Christmas, never done before! (/s) And it was rather predictable, since the scene where Lisa&apos;s daughter (who&apos;s name I definitely remember /s) gets lost I pretty much predicted the whole movie. The acting was weak,certain parts were very corny, and (no offence), Lisa&apos;s eyes annoyed me.

Now&apos;s the part where i&apos;ll discard all of the problems and full-heartedly defend this movie! The idea is like many Hallmark Christmas movies, but more over the top. And people say that this movie is unrealistic and the idea is stupid, and for that I have one word: So? This is a Christmas movie for gods sake! Who the hell is going to sit here and critically judge a CHRISTMAS movie for crying out loud? The idea is fun and that&apos;s whats the only thing that matters in a Christmas movie. Christmas needs to be cheerful, heart-warming, not serious.

I rest my case.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'gunes-17052', 'dateCreated': '2023-03-10', 'inLanguage': 'English', 'heading': 'Excellent Movie', 'reviewBody': 'One of the best movies i have watched for a long time. I will certainly Watch it again to catch up the parts i have missed and to better figure the hidden messages and facts.

The movie brings several aspects of crimes together that can be observed in Turkey, as well as in all over the world. Really staggering to see so many bad people together in the same arena. My Congratulations goes to the author Mehmet Eroglu and to the staff who brought this story with very successful Artists into our screen. Also thank to Netflix for supporting film industry.

Looking forward to the next volumes of the Triology.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'olaarmyever', 'dateCreated': '2023-06-29', 'inLanguage': 'English', 'heading': 'Really underrated', 'reviewBody': 'This is one of the few things i watched without looking at the rating first and tbh I would&apos;ve not watch it with rating like this but im very glad i did For me this movie gives perspective to what goes into a relationship and how complicated and beautiful it is.

I was actually surprised it wasn&apos;t a cliche romance and unrealistic drama,it touched me I rewatched a couple of scenes from how good it was the actress did a phenomenal job and I appreciate how the time line is filmed you have to pay attention though you never know when its flash back or not sometimes.

You have to give it a shot it is worth it.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'hfsaidi', 'dateCreated': '2023-09-29', 'inLanguage': 'English', 'heading': 'A well-executed, tense survival thriller', 'reviewBody': 'This is indeed one of the best lost at sea movies I have seen in years. In fact, it should be in the same league as Cast Away. Through out its entire running time, I was almost on the edge of my seat. Anna Castillo&apos;s acting is prominently praiseworthy. Her rather natural acting has definitely won my heart.

The film has a fair share of tense, heart pounding, and many a time, breathtaking moments that are truly reflective of Albert Pinto&apos;s splendid directorial efforts.

Great direction, great acting, making it a great movie all in all! I&apos;m surprised why there&apos;s a lower rating than 7? Watch it... you&apos;ll thoroughly enjoy it!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'Jaffa55', 'dateCreated': '2023-10-20', 'inLanguage': 'English', 'heading': 'Helps if you like Bill Burr', 'reviewBody': 'I suspect this film will get some bad reviews, particularly if you aren&apos;t familiar with Bill Burr&apos;s stand up or you find his style of comedy a bit much (Michael McIntyre he&apos;s not). Personally I&apos;m a big fan of Bill and the character he plays in this film is pretty much the one you get in his stand up shows.

The movie was written by Bill and that&apos;s evident straight from the start with the dialogue very much in his style and in line with his stand up contains several amusing scenes with middle aged men trying to understand the world of woke. However I felt the film lost some pacing and ran out of steam a little in the second half, as Bill&apos;s character makes the transition into something more acceptable to modern society.

Worth a watch if you like Bill. If you don&apos;t then maybe not.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'MissSimonetta', 'dateCreated': '2023-02-11', 'inLanguage': 'English', 'heading': 'I was actually moved by the existential crisis of this cartoon cat', 'reviewBody': 'CS Lewis once said a children&apos;s story that only appeals to children is not a good children&apos;s film in the least. I can think of plenty of crummy kids&apos; movies that illustrate the point, but I&apos;d rather bring up a positive example-- PUSS IN BOOTS: THE LAST WISH.

I cannot believe I am saying this about a Shrek spinoff, but this movie really is that good. It works on so many levels: as a high-speed comedy, all the jokes land, but as a story about mortality and the meaning of life, this film is oddly compelling and mature. The plot literally involves Puss running from the personification of death, hoping to cling to his life. In between the funny scenes, I was actually moved by the existential crisis of this cartoon cat. That&apos;s no small feat.

This is truly a movie kids and adults can cherish.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'Tweekums', 'dateCreated': '2023-04-18', 'inLanguage': 'English', 'heading': 'A solid religious horror film from Indonesia', 'reviewBody': 'This Indonesian horror film is set in a remote girls&apos; boarding school. New girl Yolanda is put under the guidance of Zahra, a senior girl with a good reputation who always obeys her teachers. It is clear that the girls are being raised as Muslims but there is something suspicious about their teacher. He instructs the girls to perform a ceremony to summon their Qorin Jinns... doppelg√§ngers. They are wary but ultimately do as instructed. It isn&apos;t long before strange things start to occur. The teacher now has power over them and his intentions are far from righteous. The girls will have to be strong and hold firm to their faith if they are to defeat him.

This might not be the best horror film I&apos;ve seen but it was enjoyable. It had plenty of creepy moments and a few good scares. The story is effective even if, like me, you aren&apos;t familiar with the culture. While it may not be in the same class, the film this reminded me of most was &apos;The Exorcist&apos;. Like that classic the evil is confronted by religious faith and a willingness to risk all... there is even a scene where a girl does the famous &apos;spider walk&apos;! The cast does a solid job and the special effects are pretty good. On the down side things are a bit too dark at times making it hard to see what is going on. Overall a decent enough film that I&apos;d recommend to fans of religious horror films looking for something set somewhere different.

These comments are based on watching the film in Indonesian with English subtitles.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'ibob-63931', 'dateCreated': '2023-08-07', 'inLanguage': 'English', 'heading': 'Old story with commercial elements', 'reviewBody': 'Rangabali movie&apos;s narrative draws clear inspiration from the intricate web of local Andhra political rivalries that dominated the 90s. While this nostalgic nod might resonate with some viewers, the film leaves a few elements that merit consideration.

For families looking to enjoy a cinematic outing, it&apos;s worth noting that Rangabali might not be the best choice if you have kids in tow. The presence of explicit liplock scenes, item songs, and intense violence throughout the movie could potentially be unsettling for younger audiences.

In terms of storytelling, it&apos;s my hope that the creators of Rangabali venture beyond the confines of conventional narratives. The film seems to blend multiple plotlines, and while experimentation is commendable, it can sometimes lead to a disjointed viewing experience.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 1}}

{'author': 'Kirpianuscus', 'dateCreated': '2022-12-28', 'inLanguage': 'English', 'heading': 'beautiful hommage', 'reviewBody': 'Homage to Roald Neame version of Scrooge, it is , for CGI more, a seductive animation inspired by the classic novel. And, sure imaginative at whole, reminding the good tastes of the fascinations specific to childhood.

I like Prudence , against the strange idea about a Scrooge as owner of a pet, I admire the scene about connection , in past, between Robert Cratchit and Ebenezer, like the inspired option for Jonathan Pryce for ghost of Jacob Marley, remembering the old beautiful work of Alec Guinness in the original version.

It is unfair to critic it . First, because it is a new demonstration of hard work with a not significant budget and about large possibilities offered by technology today. Second, because i am too old for critics. My favorit options are in the past . And this correct , imaginative, seductive Scrooge, like a noble hommage to work for 1970 Scrooge, has the beautiful virtue to remind, in fair manner,the splendid art of leslie bricusse.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'mdreser44', 'dateCreated': '2023-09-09', 'inLanguage': 'English', 'heading': 'Such a pleasure to see a healthy love story.', 'reviewBody': 'But also, it is a joy to see all the beautiful scenery of life in Turkey. The scenery chosen is very elegant.

Many people may think it too light-hearted, but I saw a depth in it that might not be obvious to some. For example, there is more respect for romance, and more depth in their relationship. A seriousness in their romantic decisionS, not shallowness.

I did ponder at times (because I&apos;m fond of philosophizing) why it offered such a &apos;European&apos; view of relations, rather than an Islamic perspective that represents 98% of the people. But I certainly didn&apos;t complain. It is a genteel story and we enjoyed it thoroughly!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'SoumikBanerjee1996', 'dateCreated': '2023-03-14', 'inLanguage': 'English', 'heading': 'The final act messes things up!', 'reviewBody': 'Even if this is a work of fiction, the things and the messages it sought to convey here show just a small portion of the terrifying reality we cannot afford to overlook!

This movie tries to educate us about that issue while presenting a relatable piece of narrative that could happen to anyone, which is the most frightening aspect of the film. In todays modern world of digital dependency, we prevalently underestimate the factor of anonymity and that could bring a slew of problems. One mistake can bring inconceivable repercussions.

Now, merely evaluating it from a cinematic point of view, it was just passable; neither great nor horrible! The first two acts are excellent because they happen to construct a tense, suspenseful buildup, but when the third act gets underway, everything falls apart. I&apos;m not certain as to what exactly went wrong, but they were just not able to maintain the momentum or the true essence of the tale.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'Rachelle8765', 'dateCreated': '2022-11-24', 'inLanguage': 'English', 'heading': 'A very pleasant surprise', 'reviewBody': 'I was binging some cheesy Christmas movies and I saw this and I thought ok sounds like another typical 4, 5 average I&apos;ll pass the time.

I was surprised, it was a really very nice movie. I even shed a tear there at the end.

I really liked it. Great movie, great acting. It touches on so many painful subjects but not in a heavy way. The actors are all great, nothing cheesy and it does have a Christmas vibe to it. Ok well maybe a few scenes were slightly cheesy but the rest is really good and sad , that I was really thrilled and smiled at those cheesy moments. I finished the movie having a lot of thoughts about my own life and the people in it, so relatable. Definitely not what i expected feeling after a Christmas movie.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'vicanderson-65111', 'dateCreated': '2022-03-11', 'inLanguage': 'English', 'heading': 'Slightly cringey but what 13 year old girl isn&apos;t?!', 'reviewBody': 'There&apos;s a reason this movie is a PG and not a U! Everyone having a little turn because a 13 year old girl is given some maxi pads and has crushes on boys - it&apos;s not woke, it&apos;s reality.

And if you have a problem with characters wearing turbans/hijabs, then I really think you need to look deep inside yourself!

This movie doesn&apos;t feel like a Disney/Pixar because it&apos;s cringey and has anime elements - but it&apos;s still fun, and my 10 and 8 year old boys had no problem at all with seeing sanitary protection because guess what, they see it in our bathroom every day!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'masonsaul', 'dateCreated': '2023-03-04', 'inLanguage': 'English', 'heading': 'Really fun 80s throwback', 'reviewBody': 'It&apos;s overly long and goes to some very random places narratively but We Have a Ghost is still a really fun 80s Amblin throwback that has plenty of charming moments and humour that hits more than it misses. It&apos;s definitely Christopher Landon&apos;s weakest film in a while but thankfully still isn&apos;t bad by any means.

The cast are all good in their undemanding roles that require them to go through the usual stereotypes and motions and David Harbour is obviously the standout with the hardest job. He has to be extremely innocent and emotive purely through movement and he pulls it off effortlessly.

Christopher Landon&apos;s direction is really good, the film has some fun set pieces combined with the right songs to make them even better and the overall earnesty of the film wins you over by the end. The CG isn&apos;t anything spectacular but it&apos;s convincing enough and rarely pushes its own limitations.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'cardsrock', 'dateCreated': '2023-02-09', 'inLanguage': 'English', 'heading': 'Astonishingly annoying', 'reviewBody': 'It&apos;s been some time that I&apos;ve been so bewildered and frustrated watching a film.

This very talented cast is absolutely wasted on a terrible script filled with inane and outdated jokes. It&apos;s 2023, I think we&apos;ve moved beyond the ridiculous viewpoints and stereotypes displayed in this film. The characters behave in such ridiculous ways. Eddie Murphy suddenly just decides to stop being a racist piece of crap and Julia Louis-Dreyfus has an awakening about how to speak to black people normally. It&apos;s all just so freaking annoying to watch.

Hill and London also have net zero chemistry between them, which funny enough, really tends to tank a romantic comedy.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 4}}

{'author': 'bryonyb-75948', 'dateCreated': '2022-12-17', 'inLanguage': 'English', 'heading': 'A Fun Light-Hearted Rom-com', 'reviewBody': 'A fun light-hearted romantic comedy movie from Turkey. It&apos;s not to be taken too seriously.

The acting is not brilliant, but it&apos;s not bad either. The storyline is cute about a beautiful girl named Azra ( Bensu Soral from Icerde) who takes up private lessons with girls who wish to improve themselves and win the hearts of men. She helps a helpless but pretty girl get the man of her dreams, while falling in love in the process with her handsome neighbour named Burak.

I recommend anyone to watch it. It truly is one to watch. I&apos;m not one for rom-coms but this Turkish gems is one to watch no doubt about it.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}
